column2:
When the following code is run, what is the output?

var x = 42;
x = "100";
console.log(x);

What is output to the console when this code is run?

var f = function(a) {
    return a.length;
}
var val = f.call(null, [1, 2, 3]);
console.log(val);

What is output to the console when this code is run?

var f = function(a) {
    return a.length;
}
var val = f.apply(null, ["abcd", "123", "456"]);
console.log(val);

What is output to the console when this code is run?

var f = function(a) {
    return a.length;
}
var val = f.bind(null, ["abcd", "123", "456"])();
console.log(val);
